import React from 'react';

export default function Admin() {
  return (
    <div style={{padding: "20px"}}>
      <h2>系统管理</h2>
      <div style={{marginTop: "1rem"}}>
        <button style={{
          backgroundColor: "#27ae60",
          color: "white",
          padding: "8px 16px",
          border: "none",
          borderRadius: "4px",
          marginRight: "10px"
        }}>
          用户管理
        </button>
        <button style={{
          backgroundColor: "#2980b9",
          color: "white",
          padding: "8px 16px",
          border: "none",
          borderRadius: "4px"
        }}>
          系统设置
        </button>
      </div>
    </div>
  );
}
